# Prevent the Python app icon from appearing in the Dock
info = AppKit.NSBundle.mainBundle().infoDictionary()
info['LSUIElement'] = True


class App:
    def __init__(self, master):
        bgcolor = "#EDEDED"
        font = tkFont.nametofont('TkDefaultFont')
        font.config(family='Helvetica Neue', size=14)
        self.master = master
        self.master.protocol('WM_DELETE_WINDOW', self.cancel)
        self.master.option_add("*Font", font)
        self.master.tk_setPalette(highlightbackground=bgcolor, background=bgcolor)
        self.master.call('wm', 'attributes', '.', '-topmost', True)
        self.master.title("Order Your iPhone")
        menubar = Tkinter.Menu(self.master)
        self.master.config(bg=bgcolor, menu=menubar)

        self.zendesk = Zendesk()

        self.photos = dict()
        self.photos['iphone5c-blue'] = Tkinter.PhotoImage(data=gif_iphone5c_blue)
        self.photos['iphone5c-green'] = Tkinter.PhotoImage(data=gif_iphone5c_green)
        self.photos['iphone5c-pink'] = Tkinter.PhotoImage(data=gif_iphone5c_pink)
        self.photos['iphone5c-white'] = Tkinter.PhotoImage(data=gif_iphone5c_white)
        self.photos['iphone5c-yellow'] = Tkinter.PhotoImage(data=gif_iphone5c_yellow)
        self.photos['iphone5s-gold'] = Tkinter.PhotoImage(data=gif_iphone5s_gold)
        self.photos['iphone5s-gray'] = Tkinter.PhotoImage(data=gif_iphone5s_gray)
        self.photos['iphone5s-silver'] = Tkinter.PhotoImage(data=gif_iphone5s_silver)
        self.photos['iphone6-gold'] = Tkinter.PhotoImage(data=gif_iphone6_gold)
        self.photos['iphone6-gray'] = Tkinter.PhotoImage(data=gif_iphone6_gray)
        self.photos['iphone6-silver'] = Tkinter.PhotoImage(data=gif_iphone6_silver)
        self.photos['iphone6p-gold'] = Tkinter.PhotoImage(data=gif_iphone6p_gold)
        self.photos['iphone6p-gray'] = Tkinter.PhotoImage(data=gif_iphone6p_gray)
        self.photos['iphone6p-silver'] = Tkinter.PhotoImage(data=gif_iphone6p_silver)

        self.frameLeft = Tkinter.Frame(self.master)
        self.photoCanvas = Tkinter.Canvas(self.frameLeft, width=300, height=300)
        self.photoCanvas.pack()
        self.displayedPhoto = self.photoCanvas.create_image(0, 0, anchor='nw', image=self.photos['iphone5c-blue'])
        self.frameLeft.grid(row=0, column=0)

        self.selection_hasiPhone = Tkinter.IntVar()
        self.selection_hasiPhone.set(0)
        self.selection_model = Tkinter.IntVar()
        self.selection_model.set(0)
        self.selection_storage = Tkinter.IntVar()
        self.selection_storage.set(0)
        self.selection_color = Tkinter.IntVar()
        self.selection_color.set(0)
        self.entry_phone_number = Tkinter.StringVar()
        self.selection_office = Tkinter.IntVar()
        self.selection_office.set(0)

        self.frameRight = Tkinter.Frame(self.master)
        self.hasiPhone = Tkinter.Checkbutton(self.frameRight, text="I already have a JAMF provided iPhone",
                                             variable=self.selection_hasiPhone, command=self.clickon_hasiPhone)
        self.hasiPhone.pack(anchor='w', pady=(15, 0))

        Tkinter.Label(self.frameRight, text='Select a model:').pack(anchor='w', pady=(10, 0))
        self.frameRight_models = Tkinter.Frame(self.frameRight)
        self.model_iPhone5c = Tkinter.Radiobutton(self.frameRight_models, text=' iPhone 5c', width=11, justify='left',
                                                  variable=self.selection_model, command=self.clickon_model, value=0)
        self.model_iPhone5s = Tkinter.Radiobutton(self.frameRight_models, text=' iPhone 5s', width=11, justify='left',
                                                  variable=self.selection_model, command=self.clickon_model, value=1)
        self.model_iPhone6 = Tkinter.Radiobutton(self.frameRight_models, text=' iPhone 6', width=10, justify='left',
                                                 variable=self.selection_model, command=self.clickon_model, value=2)
        self.model_iPhone6p = Tkinter.Radiobutton(self.frameRight_models, text=' iPhone 6 Plus', width=14,
                                                  justify='left', variable=self.selection_model,
                                                  command=self.clickon_model, value=3)
        self.model_iPhone5c.grid(row=0, column=0)
        self.model_iPhone5s.grid(row=0, column=1)
        self.model_iPhone6.grid(row=0, column=2)
        self.model_iPhone6p.grid(row=0, column=3)
        self.frameRight_models.pack(padx=15, pady=(5, 0), anchor='w')

        Tkinter.Label(self.frameRight, text='Select storage capacity:').pack(anchor='w', pady=(10, 0))
        self.frameRight_storage = Tkinter.Frame(self.frameRight)
        self.storage_8gb = Tkinter.Radiobutton(self.frameRight_storage, text=' 8 GB', width=8, justify='left',
                                               variable=self.selection_storage, value=0)
        self.storage_16gb = Tkinter.Radiobutton(self.frameRight_storage, text=' 16 GB', width=10, justify='left',
                                               variable=self.selection_storage, value=1, state='disabled')
        self.storage_32gb = Tkinter.Radiobutton(self.frameRight_storage, text=' 32 GB', width=10, justify='left',
                                               variable=self.selection_storage, value=2, state='disabled')
        self.storage_64gb = Tkinter.Radiobutton(self.frameRight_storage, text=' 64 GB', width=10, justify='left',
                                               variable=self.selection_storage, value=3, state='disabled')
        self.storage_8gb.grid(row=0, column=0)
        self.storage_16gb.grid(row=0, column=1)
        self.storage_32gb.grid(row=0, column=2)
        self.storage_64gb.grid(row=0, column=3)
        self.frameRight_storage.pack(padx=15, pady=(5, 0), anchor='w')

        self.labelText_color = Tkinter.StringVar()
        self.labelText_color.set("Select a color for your iPhone 5c:")

        Tkinter.Label(self.frameRight, textvariable=self.labelText_color).pack(anchor='w', pady=(10, 0))
        self.frameRight_iPhone5c_colors = Tkinter.Frame(self.frameRight)
        self.color_blue = Tkinter.Radiobutton(self.frameRight_iPhone5c_colors, text=' Blue', width=12, justify='left',
                                              variable=self.selection_color, command=self.clickon_color, value=0)
        self.color_green = Tkinter.Radiobutton(self.frameRight_iPhone5c_colors, text=' Green', width=12, justify='left',
                                               variable=self.selection_color, command=self.clickon_color, value=1)
        self.color_pink = Tkinter.Radiobutton(self.frameRight_iPhone5c_colors, text=' Pink', width=12, justify='left',
                                              variable=self.selection_color, command=self.clickon_color, value=2)
        self.color_white = Tkinter.Radiobutton(self.frameRight_iPhone5c_colors, text=' White', width=12, justify='left',
                                               variable=self.selection_color, command=self.clickon_color, value=3)
        self.color_yellow = Tkinter.Radiobutton(self.frameRight_iPhone5c_colors, text=' Yellow', width=12,
                                                justify='left', variable=self.selection_color,
                                                command=self.clickon_color, value=4)
        self.color_blue.grid(row=0, column=0)
        self.color_green.grid(row=0, column=1)
        self.color_pink.grid(row=0, column=2)
        self.color_white.grid(row=1, column=0)
        self.color_yellow.grid(row=1, column=1)
        self.frameRight_iPhone5c_colors.pack(padx=15, pady=(5, 0), anchor='w')

        self.frameRight_iPhone5s_colors = Tkinter.Frame(self.frameRight)
        self.color_gold = Tkinter.Radiobutton(self.frameRight_iPhone5s_colors, text=' Gold', width=12, justify='left',
                                              variable=self.selection_color, command=self.clickon_color, value=5,
                                              state='disabled')
