    def submit(self):
        if self.selection_hasiPhone.get() == 1:
            self.master.destroy()
            sys.exit(0)

        if self.phone_number.cget('state') == 'normal':
            phone = self.entry_phone_number.get()
            phone = re.compile(r'[^\d.]+').sub('', phone)
            if len(phone) == 10:
                phone = "({0}) {1}-{2}".format(phone[0:3], phone[3:6], phone[6:])
            else:
                tkMessageBox.showerror("Valid Phone Number Required", "You must enter a valid 10-digit phone number.",
                                       parent=self.master)
                return
        else:
            phone = None

        self.zendesk.finduser()

        if not (self.zendesk.zen_userid or self.zendesk.zen_username):
            tkMessageBox.showerror("Not Found", "Your user record could not be found. Please contact IT.",
                                   parent=self.master)
            sys.exit(1)

        comment = "An iPhone order has been placed by {0}.\n\n".format(self.zendesk.zen_username)

        selected_model = self.selection_model.get()
        if selected_model == 0:
            model = "iPhone 5c"
        elif selected_model == 1:
            model = "iPhone 5s"
        elif selected_model == 2:
            model = "iPhone 6"
        else:
            model = "iPhone 6 Plus"

        selected_storage = self.selection_storage.get()
        if selected_storage == 0:
            storage = "8 GB"
        elif selected_storage ==1:
            storage = "16 GB"
        elif selected_storage == 2:
            storage = "32 GB"
        else:
            storage = "64 GB"

        selected_color = self.selection_color.get()
        if selected_color == 0:
            color = "Blue"
        elif selected_color == 1:
            color = "Green"
        elif selected_color == 2:
            color = "Pink"
        elif selected_color == 3:
            color = "White"
        elif selected_color == 4:
            color = "Yellow"
        elif selected_color == 5:
            color = "Gold"
        elif selected_color == 6:
            color = "Gray"
        else:
            color = "Silver"

        selected_office = self.selection_office.get()
        if selected_office == 0:
            office = "Eau Claire"
        elif selected_office == 1:
            office = "Minneapolis"
        else:
            office = "International"

        comment += "Model: {0}\nStorage: {1}\nColor: {2}\nLocation: {3}".format(model, storage, color, office)

        if phone:
            comment += "\nDesk Phone Number: {0}".format(phone)

        if self.zendesk.createticket(self.zendesk.ticketdata(comment)) != 201:
            tkMessageBox.showerror("Submission Failed",
                                   "Your iPhone order could not be submitted at this time. Please contact IT.",
                                   parent=self.master)
            self.master.destroy()
            sys.exit(1)
        else:
            tkMessageBox.showinfo("Thank You!", "Your iPhone order has been submitted as an IT Help ticket.",
                                  parent=self.master)
            self.master.destroy()
            sys.exit(0)

    def cancel(self):
        self.master.destroy()
        sys.exit(0)

    def clickon_hasiPhone(self):
        if self.selection_hasiPhone.get() == 0:
            enable_widgets = [self.model_iPhone5c, self.model_iPhone5s, self.model_iPhone6, self.model_iPhone6p,
                              self.storage_8gb, self.color_blue, self.color_green, self.color_pink, self.color_white,
                              self.color_yellow, self.office_EC, self.office_MSP, self.office_Int, self.phone_number]
            self.change_states(enable_widgets)
        else:
            disable_widgets = [self.model_iPhone5c, self.model_iPhone5s, self.model_iPhone6, self.model_iPhone6p,
                               self.storage_8gb, self.storage_16gb, self.storage_32gb, self.storage_64gb,
                               self.color_blue, self.color_green, self.color_pink, self.color_white, self.color_yellow,
                               self.color_gold, self.color_gray, self.color_silver, self.office_EC, self.office_MSP,
                               self.office_Int, self.phone_number]
            self.change_states(None, disable_widgets)
            self.selection_model.set(0)
            self.selection_storage.set(0)
            self.selection_color.set(0)
            self.selection_office.set(0)
            # self.selection_headset.set(1)
            self.photoCanvas.itemconfig(self.displayedPhoto, image=self.photos['iphone5c-blue'])

    def clickon_model(self):
        iphone5c_colors = [self.color_blue, self.color_green, self.color_pink, self.color_white, self.color_yellow]
        iphone5s_colors = [self.color_gold, self.color_gray, self.color_silver]
        model = self.selection_model.get()
        if model == 0:
            self.selection_storage.set(0)
            valid_storage = [self.storage_8gb]
            invalid_storage = [self.storage_16gb, self.storage_32gb, self.storage_64gb]
            self.change_states(valid_storage, invalid_storage)
            self.change_states(iphone5c_colors, iphone5s_colors)
            self.labelText_color.set("Select a color for your iPhone 5c:")
            self.selection_color.set(0)
            self.photoCanvas.itemconfig(self.displayedPhoto, image=self.photos['iphone5c-blue'])
        elif model == 1:
            self.selection_storage.set(1)
            valid_storage = [self.storage_16gb, self.storage_32gb]
            invalid_storage = [self.storage_8gb, self.storage_64gb]
            self.change_states(valid_storage, invalid_storage)
            self.change_states(iphone5s_colors, iphone5c_colors)
            self.labelText_color.set("Select a color for your iPhone 5s:")
            self.selection_color.set(5)
            self.photoCanvas.itemconfig(self.displayedPhoto, image=self.photos['iphone5s-gold'])
        elif model == 2:
            self.selection_storage.set(1)
            valid_storage = [self.storage_16gb, self.storage_64gb]
            invalid_storage = [self.storage_8gb, self.storage_32gb]
            self.change_states(valid_storage, invalid_storage)
            self.change_states(iphone5s_colors, iphone5c_colors)
            self.labelText_color.set("Select a color for your iPhone 6:")
            self.selection_color.set(5)
            self.photoCanvas.itemconfig(self.displayedPhoto, image=self.photos['iphone6-gold'])
        else:
            self.selection_storage.set(1)
            valid_storage = [self.storage_16gb]
            invalid_storage = [self.storage_8gb, self.storage_32gb, self.storage_64gb]
            self.change_states(valid_storage, invalid_storage)
            self.change_states(iphone5s_colors, iphone5c_colors)
            self.labelText_color.set("Select a color for your iPhone 6 Plus:")
            self.selection_color.set(5)
            self.photoCanvas.itemconfig(self.displayedPhoto, image=self.photos['iphone6p-gold'])

    def change_states(self, enable=None, disable=None):
        if enable:
            for item in enable:
                item.configure(state='normal')

        if disable:
            for item in disable:
                item.configure(state='disabled')

